<!DOCTYPE html>
<html>
<head lang="en">
    <meta charset="UTF-8">
    <title></title>
    <style>
        *{
            margin: 0;
            padding: 0;}
        #box{
            margin-right: -13px;
            background: #ffffff;
        }
        #box div{
            width: 2px;
            height:2px;
            margin-right: 1px;
            margin-bottom: 1px;
            float: left;
            background:lightgoldenrodyellow;
        }
    </style>
    <script>
        window.onload = function(){
            function tab(){
                var oBox = document.getElementById('box');
                var aDiv = oBox.getElementsByTagName('div');
                var rnd = parseInt(Math.random()*256);
                var rnd1 = parseInt(Math.random()*256);
                var rnd2 = parseInt(Math.random()*256);
                var rnd3 = Math.random();
                for(var i=0;i<aDiv.length;i++){
                    aDiv[i].index = i;
                     aDiv[i].onclick = function(){
                        for(var i=0;i<aDiv.length;i++){
                            aDiv[this.index-1].style.background = '';
                        }
                        aDiv[this.index].style.background = 'rgba('+rnd+','+rnd1+','+rnd2+','+rnd3+')';
                    };
                    }
            }
            tab();
            setInterval(tab,16);

        };
    </script>
